import React from "react"
import './App.css';
import Header from "./Header"
import GameContainer from "./GameContainer";
import gameData from "./data/db.json"
import NewGameForm  from "./NewGameForm";

function App() {





  return (
    <div className="App">
        <Header />
        <NewGameForm />
        <GameContainer gameData={gameData}/>
    </div>
  );
}

export default App;
